import React, { useState } from "react";

function TodoList() {
  const [todos, setTodos] = useState([]);
  const [task, setTask] = useState("");
  const [category, setCategory] = useState("General");
  const [categories, setCategories] = useState(["General", "Work", "Home"]);
  const [newCategory, setNewCategory] = useState("");

  // ‚úÖ ‡πÄ‡∏û‡∏¥‡πà‡∏° Todo
  const handleAddTodo = () => {
    if (!task.trim()) return;
    setTodos([...todos, { task: task.trim(), category }]);
    setTask("");
  };

  // ‚úÖ ‡∏•‡∏ö Todo
  const handleDeleteTodo = (index) => {
    const updated = [...todos];
    updated.splice(index, 1);
    setTodos(updated);
  };

  // ‚úÖ ‡πÄ‡∏û‡∏¥‡πà‡∏° Category ‡πÉ‡∏´‡∏°‡πà
  const handleAddCategory = () => {
    if (!newCategory.trim()) return;
    if (!categories.includes(newCategory.trim())) {
      setCategories([...categories, newCategory.trim()]);
      setNewCategory("");
    } else {
      alert("Category ‡∏ô‡∏µ‡πâ‡∏°‡∏µ‡∏≠‡∏¢‡∏π‡πà‡πÅ‡∏•‡πâ‡∏ß!");
    }
  };

  return (
    <div style={styles.container}>
      <h1>üìù Todo List with Category</h1>

      <div style={{ marginBottom: 15 }}>
        <input
          type="text"
          placeholder="‡∏û‡∏¥‡∏°‡∏û‡πå‡∏á‡∏≤‡∏ô‡∏Ç‡∏≠‡∏á‡∏Ñ‡∏∏‡∏ì"
          value={task}
          onChange={(e) => setTask(e.target.value)}
          style={styles.input}
        />
        <select value={category} onChange={(e) => setCategory(e.target.value)} style={styles.select}>
          {categories.map((cat, idx) => (
            <option key={idx} value={cat}>
              {cat}
            </option>
          ))}
        </select>
        <button style={styles.btn} onClick={handleAddTodo}>
          ‚ûï Add Todo
        </button>
      </div>

      {/* ‡πÄ‡∏û‡∏¥‡πà‡∏° Category ‡πÉ‡∏´‡∏°‡πà */}
      <div style={{ marginBottom: 20 }}>
        <input
          type="text"
          placeholder="‡πÄ‡∏û‡∏¥‡πà‡∏° Category ‡πÉ‡∏´‡∏°‡πà"
          value={newCategory}
          onChange={(e) => setNewCategory(e.target.value)}
          style={styles.input}
        />
        <button style={styles.btn} onClick={handleAddCategory}>
          ‚ûï Add Category
        </button>
      </div>

      {/* ‡πÅ‡∏™‡∏î‡∏á Todo ‡∏ï‡∏≤‡∏° Category */}
      {categories.map((cat, idx) => {
        const catTodos = todos.filter((todo) => todo.category === cat);
        if (catTodos.length === 0) return null;
        return (
          <div key={idx} style={{ marginBottom: 15 }}>
            <h3>{cat}</h3>
            <ul>
              {catTodos.map((todo, tIdx) => (
                <li key={tIdx} style={{ marginBottom: 5 }}>
                  {todo.task}{" "}
                  <button style={styles.deleteBtn} onClick={() => handleDeleteTodo(todos.indexOf(todo))}>
                    ‚ùå
                  </button>
                </li>
              ))}
            </ul>
          </div>
        );
      })}
    </div>
  );
}

