const styles = {
  container: {
    textAlign: "center",
    padding: 30,
    width: 500,
    margin: "40px auto",
    background: "#f0f0f0",
    borderRadius: 15,
    boxShadow: "0 0 10px rgba(0,0,0,0.1)",
  },
  input: {
    padding: 8,
    fontSize: 16,
    borderRadius: 5,
    border: "1px solid #ccc",
    marginRight: 10,
  },
  select: {
    padding: 8,
    fontSize: 16,
    borderRadius: 5,
    border: "1px solid #ccc",
    marginRight: 10,
  },
  btn: {
    padding: "8px 12px",
    fontSize: 16,
    borderRadius: 5,
    border: "none",
    backgroundColor: "#2196f3",
    color: "white",
    cursor: "pointer",
  },
  deleteBtn: {
    marginLeft: 10,
    padding: "2px 6px",
    fontSize: 12,
    borderRadius: 5,
    border: "none",
    backgroundColor: "#e53935",
    color: "white",
    cursor: "pointer",
  },
};

export default TodoList;
